// Read the CSV file 'users.csv' from the project directory
def csvFile = new File('users.csv')
// Read all lines from the CSV file
def lines = csvFile.readLines()
// Extract header columns
def headers = lines[0].split(',')

// Loop through each data row starting from line 1
for (int i = 1; i < lines.size(); i++) {
    // Split the current line by comma to get column values
    def values = lines[i].split(',')
    // Map column names to their respective values
    def data = [:]
    for (int j = 0; j < headers.length; j++) {
        data[headers[j].trim()] = values[j].trim()
    }
    // Open URL: https://example.com/login
    WebUI.openBrowser('')
    WebUI.navigateToUrl('https://example.com/login')
    // Enter username from 'username' column into Test Object 'Page_Login/input_username'
    WebUI.setText(findTestObject('Page_Login/input_username'), data['username'])
    // Enter password from 'password' column into Test Object 'Page_Login/input_password'
    WebUI.setText(findTestObject('Page_Login/input_password'), data['password'])
    // Click Test Object 'Page_Login/button_login'
    WebUI.click(findTestObject('Page_Login/button_login'))
    // Verify if Test Object 'Page_Dashboard/div_success_message' is present
    WebUI.verifyElementPresent(findTestObject('Page_Dashboard/div_success_message'), 10)
    // Close browser after each iteration
    WebUI.closeBrowser()
}

